function checkPlayerBounds(dt) {
    // Check bounds
    if(player.pos[0] < 0) {
        //player.pos[0] = 0;
         //var announce = "Moving to the LEFT and minimapX = " + minimapX + " and minimapY = " + minimapY;
        //alert(announce);
        screenTrans = true;
        screenTransDir = "left";
        //minimapX -= 1;

        changeScreen();
        paintWorld();
        overworld = overworldTemp;
        //alert(announce);

    }
    else if(player.pos[0] > canvas.width - player.sprite.size[0] + 5) {
        //player.pos[0] = canvas.width - player.sprite.size[0];
        screenTrans = true;
        screenTransDir = "right";


        changeScreen();
        paintWorld();
        overworld = overworldTemp;
    }

    if(player.pos[1] < (0+(16*5)+2)) {
        screenTrans = true;
        screenTransDir = "up";
        //minimapY -= 1;

        changeScreen();
        paintWorld();
        overworld = overworldTemp;
    }
    else if(player.pos[1] > canvas.height - player.sprite.size[1]) {
        //player.pos[1] = canvas.height - player.sprite.size[1];
        screenTrans = true;
        screenTransDir = "down";
        //minimapY -= 1;

        changeScreen();
        paintWorld();
        overworld = overworldTemp;
    }
}
function screenTransition(pos, dt){
        renderEntitiesTrans(worlds);
        renderEntitiesTransTop(worlds);
        renderEntitiesMinimap(minimap);
        var condition;
        if (screenTransDir == "left"){ player.pos[0] += 8; condition = ((player.pos[0]+7) > canvas.width - player.sprite.size[0]); }
        if (screenTransDir == "right"){ player.pos[0] -= 8;  condition = ((player.pos[0]-7) < 0 ); }
        if (screenTransDir == "up"){ player.pos[1] += 8;condition =  ((player.pos[1]+7) > canvas.height - player.sprite.size[1]);}
        if (screenTransDir == "down"){ player.pos[1] -= 8;condition =  (player.pos[1]-7 < (0+(16*5)+2));}

        player.sprite.update(dt);
        renderEntity(player);
        if (   condition
                    ){
            screenTrans = false;
            overworldTemp = [];
            changeScreen();
            worlds = [];
            //minimap = [];
            if (screenTransDir == "left") minimapX -= 1;
            if (screenTransDir == "right") minimapX += 1;
            if (screenTransDir == "up") minimapY -= 1;
            if (screenTransDir == "down") minimapY += 1;
            paintWorld();
            renderEntitiesInit(worlds);
            renderEntitiesTransTop(worlds);
            renderEntitiesMinimap(minimap);

            printScreenAgain = true;


            //paintWorld();
            //alert("HI");

        }



}
