// Collisions

function collides(x, y, r, b, x2, y2, r2, b2) {
    return !(r <= x2 || x > r2 ||
             b <= y2 || y > b2);
}

function boxCollides(pos, size, pos2, size2) {
    return collides(pos[0], pos[1],
                    pos[0] + size[0], pos[1] + size[1],
                    pos2[0], pos2[1],
                    pos2[0] + size2[0], pos2[1] + size2[1]);
}

function checkCollisions(dt) {
    checkPlayerBounds(dt);

}

function render() {
    // Render the player if the game isn't over
    renderEntitiesInit(worlds);
    var randy = Math.floor((Math.random() * 40) + 1);

    if (flicker == true){
    ctx.save();
    ctx.beginPath();
    ctx.arc(player.pos[0], player.pos[1], 164, 0, 2 * Math.PI, false);
    ctx.clip();

    renderEntitiesInit(worlds);

    ctx.beginPath();
    ctx.arc(player.pos[0], player.pos[1], 164, 0, 2 * Math.PI, false);
    ctx.lineWidth = 20;
    ctx.strokeStyle = 'black';
    ctx.fill();
    ctx.restore();
    if (randy == 1){
            flicker = false;
    }

    } else {
        if (randy == 4){
            flicker = true;
        }
    }



    renderEntitiesTransTop(worlds);
    darkmask.render(ctx);
    lighting.render(ctx);

    renderEntitiesMinimap(minimap);

    if(!isGameOver) {
        renderEntity(player);
    }

    //renderEntities(bullets);

};

function renderEntities(list) {
    myY = Math.round((player.pos[1])/16)*16;
    myX = Math.round((player.pos[0])/16)*16;

    for(var i=0; i<list.length; i++) {
        if (    ((list[i].pos[0] == myX) || (list[i].pos[0] == (myX+16)) || (list[i].pos[0] == (myX-16))) &&
                ((list[i].pos[1] == myY) || (list[i].pos[1] == (myY+16)) || (list[i].pos[1] == (myY-16)))   )
        renderEntity(list[i]);
    }
}

function renderEntitiesInit(list) {

    for(var i=0; i<list.length; i++) {
        if (list[i].pos[1] > (4*16))
        renderEntityInit(list[i]);
    }
}

function renderEntitiesMinimap(list) {

    for(var i=0; i<list.length; i++) {
        renderEntityInit(list[i]);
    }
}
function renderEntitiesTrans(list) {

    for(var i=0; i<list.length; i++) {
        if (list[i].pos[1] > (0*16)){
            if (screenTransDir == "left")   list[i].pos[0] += 8;
            if (screenTransDir == "up")     list[i].pos[1] += 8;
            if (screenTransDir == "right")  list[i].pos[0] -= 8;
            if (screenTransDir == "down")   list[i].pos[1] -= 8;

            renderEntity(list[i]);
        }
    }
}

function renderEntitiesTransTop(list) {

    for(var i=0; i<list.length; i++) {
        if (list[i].pos[1] <= (5*16) && (list[i].type == -1)){

            renderEntityInit(list[i]);
        }
    }
}
function renderEntity(entity) {

    if (entity.pos[1] > ((4*16)+8)){
        ctx.save();
        ctx.translate(entity.pos[0], entity.pos[1]);
        entity.sprite.render(ctx);
        ctx.restore();
    }
}
function renderEntityInit(entity) {
    ctx.save();
    ctx.translate(entity.pos[0], entity.pos[1]);
    entity.sprite.render(ctx);
    ctx.restore();
}

// Game over
function gameOver() {
    isGameOver = true;
}

// Reset game to original state
function reset() {
    isGameOver = false;
    gameTime = 0;
    score = 0;

    myX = 70;
    myY = canvas.height / 2;
    player.pos = [70, canvas.height / 2];
};

